import React from "react";

const Root = () => {
    return (
        <div className="w-screen h-screen font-sans font-light">
            <div className="flex space-x-8 w-full h-32 px-10 py-4">
                <p className="text-xl">VKV RESTAURATIES</p>
                <div className="flex flex-col text-xs py-1">
                    <p className="hover:underline cursor-pointer">PROJECTEN</p>
                    <p className="hover:underline cursor-pointer">OVER ONS</p>
                    <p className="hover:underline cursor-pointer">CONTACT</p>
                    <p className="hover:underline cursor-pointer">KAART</p>
                </div>
            </div>
            <div>
                <img src="../assets/images/K-210-11_c1hfol.jpg" alt="welcome image" className="w-full h-full object-cover" />
            </div>
        </div>
    );
}

export default Root;
